#
# TABLE STRUCTURE FOR: sounds
#

DROP TABLE IF EXISTS `sounds`;

CREATE TABLE `sounds` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `executor_id` int(10) unsigned NOT NULL,
  `text_sound_id` int(10) unsigned NOT NULL,
  `genre_id` int(10) unsigned NOT NULL,
  `lang_sound_id` int(10) unsigned NOT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  UNIQUE KEY `text_sound_id` (`text_sound_id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: text_sound
#

DROP TABLE IF EXISTS `text_sound`;

CREATE TABLE `text_sound` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `text_sound` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



